import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';

const WatchlistPage = () => {
    const [watchlists, setWatchlists] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetchWatchlists();
    }, []);

    const fetchWatchlists = async () => {
        const user = supabase.auth.user();
        if (!user) {
            navigate('/login');
            return;
        }

        const { data, error } = await supabase
            .from('watchlists')
            .select('*')
            .eq('user_id', user.id);

        if (error) {
            console.log('Error fetching watchlists:', error.message);
        } else {
            setWatchlists(data);
        }
    };

    return (
        <div className="container mx-auto p-4">
            <h1 className="text-xl font-bold">Your Watchlists</h1>
            {watchlists.map((list) => (
                <div key={list.id} className="p-2 border-b">
                    <button className="text-blue-500 hover:text-blue-600" onClick={() => navigate(`/${user.id}/${list.name}`)}>
                        {list.name}
                    </button>
                </div>
            ))}
        </div>
    );
};

export default WatchlistPage;
